import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import "../forgetpassword/forget.css";

function Forget() {
  return (
    <div className='fgtbg'>
        <div className='fgtbg2'>
            <div className='form mt-5'>
                <span className='head text-warning'>Forget password</span><br />
                <input className='userEmail mt-5' type=" text" placeholder='enter user e-mail' />
                <input className='newPass mt-5' type=" password" placeholder='enter new password' /><br/>

                <button className='updatePass text-white mt-5'>update</button><br/>
                <span className='remember text-white'>If remember my password?<a href="">Login!</a></span>

            </div>

        </div>
      
    </div>
  )
}

export default Forget
